function validate(getValue, getFormControlValueSafe){
    var value = getValue();
    if (value) {
        var birthDate = new Date(value);
        var today = new Date();
        var age = today.getFullYear() - birthDate.getFullYear();
        var m = today.getMonth() - birthDate.getMonth();
        if (m < 0 || (m === 0 && today.getDate() < birthDate.getDate())) {
            age--;
        }
        var maritalStatus = getFormControlValueSafe(['ApplicantDetails', 'MaritalStatusId']);
        if (age < 12 && (maritalStatus === '2' || maritalStatus === '3' || maritalStatus === '4' || maritalStatus === '5')) { 
            return true;
        }
    }
    return false;
}

