function validate(getValue, getFormControlValue)
{ 
    var passportExpiryDate = new Date(getValue());
    var dateIn180Days =  new Date();
    dateIn180Days.setDate(dateIn180Days.getDate() + 180);
    if (passportExpiryDate < dateIn180Days) {
        return true;
    }

    var dateOfIssueString = getFormControlValue(['ApplicantDetails', 'PassportIssueDate']);
    if (dateOfIssueString && passportExpiryDate <= new Date(dateOfIssueString)) {
        return true;
    }
}
